import Nav from '../Nav'

function AppLayout({ children }) {
    return (
        <div style={{ display: 'flex', background: 'rgb(255, 255, 255, 0.5)' }}>
            <Nav />
            { children }
        </div>
    )
};

export default AppLayout;
